import React, { useEffect, useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
import { Card, Row, Col, Image, Button } from "react-bootstrap";

const RecipeList = () => {
	const [recipes, setRecipes] = useState([]);
	const { query } = useParams();
	const [servingSize, setServingSize] = useState(4);
	const [showNutrition, setShowNutrition] = useState(false);

	const appId = process.env.REACT_APP_EDAMAM_APP_ID;
	const appKey = process.env.REACT_APP_EDAMAM_APP_KEY;

	useEffect(() => {
		axios
			.get(
				`https://api.edamam.com/search?q=${query}&app_id=${appId}&app_key=${appKey}`
			)
			.then((response) => setRecipes(response.data.hits))
			.catch((error) => console.error("Error:", error));
	}, [query]);

	const handleServingChange = (event) => {
		setServingSize(event.target.value);
	};

	const handleToggleNutrition = () => {
		setShowNutrition(!showNutrition);
	};

	return (
		<Row className='gx-3 gy-3'>
			{recipes.map((recipe, index) => (
				<Col
					key={index}
					xs={12}
					md={4}>
					<Card className='h-100'>
						<Card.Img
							variant='top'
							src={recipe.recipe.image}
							style={{ maxHeight: "200px", objectFit: "cover" }}
						/>
						<Card.Body className='d-flex flex-column justify-content-between'>
							<Card.Title>{recipe.recipe.label}</Card.Title>
							<Card.Text>
								<ul>
									{recipe.recipe.ingredientLines.map((ingredient, i) => (
										<li key={i}>{ingredient}</li>
									))}
								</ul>
								<p>
									<label>
										Serving size:
										<input
											type='number'
											value={servingSize}
											onChange={handleServingChange}
										/>
									</label>
								</p>
								<div className='text-center'>
									<Button
										variant='primary'
										onClick={handleToggleNutrition}>
										{showNutrition
											? "Hide Nutritional Information"
											: "Show Nutritional Information"}
									</Button>
								</div>
								{showNutrition && (
									<div className='bg-light p-3 rounded'>
										<h5>Nutritional Information</h5>
										<p>
											<strong>Energy:</strong>{" "}
											{parseFloat(
												(
													(recipe.recipe.totalNutrients?.ENERC_KCAL?.quantity /
														recipe.recipe.yield) *
													servingSize
												).toFixed(2)
											)}{" "}
											{recipe.recipe.totalNutrients?.ENERC_KCAL?.unit}
										</p>
										<p>
											<strong>Fat:</strong>{" "}
											{parseFloat(
												(
													(recipe.recipe.totalNutrients?.FAT?.quantity /
														recipe.recipe.yield) *
													servingSize
												).toFixed(2)
											)}{" "}
											{recipe.recipe.totalNutrients?.FAT?.unit}
										</p>
										<p>
											<strong>Carbs:</strong>{" "}
											{parseFloat(
												(
													(recipe.recipe.totalNutrients?.CHOCDF?.quantity /
														recipe.recipe.yield) *
													servingSize
												).toFixed(2)
											)}{" "}
											{recipe.recipe.totalNutrients?.CHOCDF?.unit}
										</p>
										<p>
											<strong>Protein:</strong>{" "}
											{parseFloat(
												(
													(recipe.recipe.totalNutrients?.PROCNT?.quantity /
														recipe.recipe.yield) *
													servingSize
												).toFixed(2)
											)}{" "}
											{recipe.recipe.totalNutrients?.PROCNT?.unit}
										</p>
									</div>
								)}
							</Card.Text>
						</Card.Body>
					</Card>
				</Col>
			))}
		</Row>
	);
};

export default RecipeList;
